import "./App.css";
import TopBar from "./components/TopBar";
import { BrowserRouter, Route, Switch} from "react-router-dom";
import About from "./components/About";


function App() {
  return (
    <BrowserRouter>
      <TopBar/>
      <Switch>
        <Route path='/about' element={<About/>} exact/>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
